svg.script:
var xmlns="http://www.w3.org/2000/svg";
var xlinkns = "http://www.w3.org/1999/xlink"; 

var cnt = 0;
var angle = 0;
var angleAdd = 0;
var initialized = false;
var viewWidth = 0;
var viewHeight = 0;
var dotCon;
var mainCon;
var dots = new Array();

var lastTime = new Date();
var timeDelay = 5000;
var fps = new Object({min:60,max:0,current:0,count:0,total:0});

function init()
{
	document.getElementById('loadTxt').style.display = 'none';
	mainCon = document.getElementById('mainCon');
	mainCon.style.display = 'block';

	dotCon = document.getElementById('dotCon');

	window.requestAnimFrame = (function()
	{
		return	window.requestAnimationFrame       || 
			window.webkitRequestAnimationFrame || 
			window.mozRequestAnimationFrame    || 
			window.oRequestAnimationFrame      || 
			window.msRequestAnimationFrame     || 
			function( callback )
			{
				window.setTimeout(callback, 1000 / 60);
			};
	})();
	 
	(function animloop()
	{
		requestAnimFrame(animloop);
		render();
	})();
	initialized = true;
}

function addDot()
{
	var dot = new Object();
	dot.e = document.createElementNS(xmlns,'use');
	if (dots.length / 2 == Math.floor(dots.length / 2)) dn = 0; else dn = 1;
	dot.e.setAttributeNS(xlinkns, 'href', '#dot' + dn);
	dotCon.appendChild(dot.e);
	dot.xs = Math.random() * 2 + 2;
	dot.ys = Math.random() * 0.4 + 0.8;
	var rnd = Math.random();
	dot.scale = 0.5 + rnd / 2;
	dot.x = 0;
	dot.y = 0;
	if (Math.round(rnd) > 0) dot.dir = -Math.random(); else dot.dir = Math.random();
	dots[dots.length] = dot;
}

function click()
{
	if (!initialized) init(); else if (angleAdd == 0) angleAdd = -1; else angleAdd = 0;
}

function render()
{
	cnt++;
	if (cnt > 4) // + dots.length / 20
	{
		addDot();
		cnt = 0;
	}

	var da = new Array();
	for (k in dots)
	{
		var dot = dots[k];
		dot.x -= dot.xs;
		dot.xs -= 0.02;
		dot.y -= dot.ys;
		var h = Math.sqrt(dot.x * dot.x + dot.y * dot.y)
		if (h > 210) dot.scale -= 0.003; // + dots.length * 0.0001;
		if (dot.scale < 0.1) dot.scale -= 0.003;
		if ((h > 385) || (dot.scale < 0)) dotCon.removeChild(dot.e); else da.push(dot);
		var s = dot.scale;
		if (h < 100) s = h / 100 * dot.scale;
		dot.e.setAttribute('transform','translate(' + (dot.x + Math.sin(dot.y / 30) * (12 - dot.y / 50  * dot.dir)) + ',' + dot.y + ') scale(' + s + ')');
	}
	dots = da;
	
	var a = Math.sin(angle / 100) * 5;
	mainCon.setAttribute('transform','rotate(' + a + ')');
	mainCon.parentNode.setAttribute('transform', 'translate(' + (a * 6.6) + ',0)');
	angle -= angleAdd;

	//fpsCount();
}

function fpsCount()
{
	fps.count++;
	fps.total++;
	var nowTime = new Date();
	var timeVar = nowTime.getTime() - lastTime.getTime();
	if (timeVar > timeDelay)
	{
		fps.current = '' + Math.round(fps.count * 10000 / timeVar) / 10;
		if (fps.current > fps.max) fps.max = fps.current;
		if (fps.current < fps.min) fps.min = fps.current;
		fps.count = 0;
		lastTime = nowTime;
		timeDelay = 1000;
		document.getElementById('fps').firstChild.nodeValue = 'FPS: ' + fps.min + ' < ' + fps.current + ' < ' + fps.max + ' | FCNT: ' + fps.total;
	}
}

function resize()
{
	viewWidth = parseFloat(window.innerWidth);
	viewHeight = parseFloat(window.innerHeight);

	var vb = document.documentElement.viewBox;
	//vb.baseVal.width = viewWidth;
	//vb.baseVal.height = viewHeight;
}

function loaded()
{
	resize();
	document.getElementById("loadTxt").style.display = 'block';
}
